---------------------------------------------------------------------------- seoulcovid 테이블 생성
drop table seoulcovid;

set linesize 1000
set pagesize 5000

CREATE TABLE seoulcovid (
연번 INT primary key,
확진일 VARCHAR2 (50) ,
환자번호 VARCHAR2 (50) ,
국적 VARCHAR2 (50) ,
환자정보 VARCHAR2 (50) ,
지역 VARCHAR2 (50) constraint seoulcovid_dept_fk references seoulpopulation(구분),
여행력 VARCHAR2 (50) ,
접촉력 VARCHAR2 (100) ,
조치사항 VARCHAR2 (50) ,
상태 VARCHAR2 (50) ,
이동경로 VARCHAR2 (50) ,
등록일 VARCHAR2 (50) ,
수정일 VARCHAR2 (50) ,
노출여부 VARCHAR2 (50)
);


update seoulcovid set 확진일 = to_date(확진일, 'MM.DD.');

commit;
